
import React, { useState, useEffect, useRef } from 'react';
import { CameraIcon } from '@heroicons/react/24/outline';
import { gsap } from 'gsap';
import toast from 'react-hot-toast';
import { FaceMesh } from '@mediapipe/face_mesh';
import { Camera } from '@mediapipe/camera_utils';

// ðŸ”Š Your alert sound URL here
const ALERT_SOUND_URL ='data:audio/wav;base64,'; // ðŸ” Replace with your real URL

const FocusTracker = ({ onFocusChange, focusThreshold = 75 }) => {
  const [isTracking, setIsTracking] = useState(false);
  const [focusScore, setFocusScore] = useState(85);
  const [cameraPermission, setCameraPermission] = useState(false);
  const [eyePosition, setEyePosition] = useState({ x: 50, y: 50 });

  const videoRef = useRef(null);
  const trackerRef = useRef(null);
  const ringRef = useRef(null);
  const canvasRef = useRef(null);
  const faceMeshRef = useRef(null);
  const cameraRef = useRef(null);
  const alertAudioRef = useRef(null);

  useEffect(() => {
    gsap.fromTo(
      trackerRef.current,
      { scale: 0, opacity: 0 },
      { scale: 1, opacity: 1, duration: 0.6, ease: 'back.out(1.7)' }
    );
    alertAudioRef.current = new Audio(ALERT_SOUND_URL);
    alertAudioRef.current.loop = true;
    alertAudioRef.current.volume = 0.6;
  }, []);

  const drawLandmarks = (landmarks, canvas) => {
    const ctx = canvas.getContext('2d');
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    if (!Array.isArray(landmarks)) return;
    for (let point of landmarks) {
      if (point && typeof point.x === 'number' && typeof point.y === 'number') {
        ctx.fillStyle = 'red';
        ctx.fillRect(point.x * canvas.width, point.y * canvas.height, 2, 2);
      }
    }
  };

  const setupFaceMesh = () => {
    const faceMesh = new FaceMesh({
      locateFile: (file) => `https://cdn.jsdelivr.net/npm/@mediapipe/face_mesh/${file}`,
    });

    faceMesh.setOptions({
      maxNumFaces: 1,
      refineLandmarks: true,
      minDetectionConfidence: 0.5,
      minTrackingConfidence: 0.5,
    });

    faceMesh.onResults((results) => {
      const canvas = canvasRef.current;
      if (!canvas) return;

      if (results.multiFaceLandmarks && results.multiFaceLandmarks.length > 0) {
        const landmarks = results.multiFaceLandmarks[0];
        drawLandmarks(landmarks, canvas);

        const leftEye = landmarks[159];
        const rightEye = landmarks[386];
        const midX = (leftEye.x + rightEye.x) / 2;
        const midY = (leftEye.y + rightEye.y) / 2;
        setEyePosition({ x: midX * 100, y: midY * 100 });

        setFocusScore((prev) => {
          const newScore = Math.min(100, prev + 3);
          if (newScore >= focusThreshold && alertAudioRef.current?.paused === false) {
            alertAudioRef.current.pause();
            alertAudioRef.current.currentTime = 0;
          }
          onFocusChange?.(newScore);
          return newScore;
        });
      } else {
        setFocusScore((prev) => {
          const newScore = Math.max(20, prev - 7);
          if (newScore < focusThreshold && alertAudioRef.current?.paused) {
            alertAudioRef.current.play().catch((e) => console.warn('Audio play error:', e));
          }
          onFocusChange?.(newScore);
          return newScore;
        });
      }
    });

    faceMeshRef.current = faceMesh;
  };

  const startTracking = async () => {
    try {
      if (!navigator.mediaDevices?.getUserMedia) {
        toast.error('Camera not supported on this device.');
        return;
      }

      const stream = await navigator.mediaDevices.getUserMedia({
        video: { width: 320, height: 240, facingMode: 'user' },
      });

      setCameraPermission(true);
      setIsTracking(true);
      toast.success('Focus tracking started!');

      if (videoRef.current) {
        videoRef.current.srcObject = stream;
        videoRef.current.play();
      }

      gsap.to(ringRef.current, {
        scale: 1.05,
        duration: 1,
        yoyo: true,
        repeat: -1,
        ease: 'sine.inOut',
      });

      setupFaceMesh();

      const camera = new Camera(videoRef.current, {
        onFrame: async () => {
          if (faceMeshRef.current) {
            await faceMeshRef.current.send({ image: videoRef.current });
          }
        },
        width: 320,
        height: 240,
      });

      camera.start();
      cameraRef.current = camera;
    } catch (err) {
      console.error('Error starting camera:', err);
      toast.error('Failed to start focus tracking');
    }
  };

  const stopTracking = () => {
    setIsTracking(false);

    if (videoRef.current?.srcObject) {
      videoRef.current.srcObject.getTracks().forEach((track) => track.stop());
      videoRef.current.srcObject = null;
    }

    if (cameraRef.current) {
      cameraRef.current.stop();
      cameraRef.current = null;
    }

    faceMeshRef.current = null;

    if (alertAudioRef.current) {
      alertAudioRef.current.pause();
      alertAudioRef.current.currentTime = 0;
    }

    setCameraPermission(false);
    gsap.killTweensOf(ringRef.current);
    gsap.set(ringRef.current, { scale: 1 });
    toast('Focus tracking stopped');
  };

  const getFocusColor = (score) => {
    if (score >= 85) return 'text-green-400 border-green-400';
    if (score >= 75) return 'text-yellow-400 border-yellow-400';
    if (score >= 60) return 'text-orange-400 border-orange-400';
    return 'text-red-400 border-red-400';
  };

  const getFocusGradient = (score) => {
    if (score >= 85) return 'from-green-500 to-emerald-500';
    if (score >= 75) return 'from-yellow-500 to-orange-500';
    if (score >= 60) return 'from-orange-500 to-red-500';
    return 'from-red-500 to-pink-500';
  };

  const getFocusMessage = (score) => {
    if (score >= 90) return 'Excellent Focus! ðŸŽ¯';
    if (score >= 80) return 'Good Focus ðŸ‘';
    if (score >= focusThreshold) return 'Moderate Focus âš ï¸';
    return 'Low Focus - Take a break? ðŸ˜´';
  };

  useEffect(() => stopTracking, []);

  return (
    <div ref={trackerRef} className="backdrop-blur-lg bg-white/10 p-6 rounded-2xl border border-white/20">
      <div className="flex items-center justify-between mb-4">
        <h3 className="text-xl font-bold text-white">AI Focus Tracker</h3>
        <div className={`flex items-center gap-2 ${isTracking ? 'text-green-400' : 'text-gray-400'}`}>
          <div className={`w-2 h-2 rounded-full ${isTracking ? 'bg-green-400 animate-pulse' : 'bg-gray-400'}`}></div>
          <span className="text-sm">{isTracking ? 'Active' : 'Inactive'}</span>
        </div>
      </div>

      <div className="text-center mb-6">
        <div
          ref={ringRef}
          className={`relative w-32 h-32 mx-auto mb-4 rounded-full border-4 focus-ring ${getFocusColor(
            focusScore
          )} overflow-hidden`}
        >
          <video ref={videoRef} autoPlay muted playsInline className="w-full h-full object-cover absolute" />
          <canvas ref={canvasRef} className="absolute top-0 left-0 w-full h-full" width={320} height={240}></canvas>

          {isTracking && (
            <div
              className="absolute w-2 h-2 bg-red-500 rounded-full transition-all duration-300"
              style={{
                left: `${eyePosition.x}%`,
                top: `${eyePosition.y}%`,
                transform: 'translate(-50%, -50%)',
              }}
            />
          )}

          <div className="absolute -bottom-2 left-1/2 transform -translate-x-1/2">
            <div
              className={`px-3 py-1 rounded-full text-xs font-bold bg-gradient-to-r ${getFocusGradient(
                focusScore
              )}`}
            >
              {Math.round(focusScore)}%
            </div>
          </div>
        </div>

        <div className="mb-4">
          <p className="text-white/80 text-sm mb-2">{getFocusMessage(focusScore)}</p>
          <div className="flex justify-between text-sm text-white/60 mb-2">
            <span>Focus Level</span>
            <span>{Math.round(focusScore)}%</span>
          </div>
          <div className="w-full bg-white/10 rounded-full h-3">
            <div
              className={`h-3 rounded-full bg-gradient-to-r ${getFocusGradient(
                focusScore
              )} transition-all duration-1000`}
              style={{ width: `${focusScore}%` }}
            ></div>
          </div>
        </div>

        {!isTracking ? (
          <button
            onClick={startTracking}
            className="flex items-center gap-2 px-6 py-3 bg-gradient-to-r from-purple-600 to-blue-600 text-white rounded-lg font-semibold hover:from-purple-700 hover:to-blue-700 transform hover:scale-105 transition-all duration-200 mx-auto"
          >
            <CameraIcon className="w-5 h-5" />
            Start Tracking
          </button>
        ) : (
          <button
            onClick={stopTracking}
            className="px-6 py-3 bg-red-600 hover:bg-red-700 text-white rounded-lg font-semibold transform hover:scale-105 transition-all duration-200"
          >
            Stop Tracking
          </button>
        )}
      </div>

      <div className="text-xs text-white/60 text-center space-y-1">
        <p>AI analyzes eye movement and face visibility</p>
        <p>Focus score drops when face is not detected</p>
      </div>
    </div>
  );
};

export default FocusTracker;
